import React from 'react';
import Card from './Card';


const CardList = ({ robots }) => {
    return (
        <div>
            {
                robots.map((user,i)=>{
                <Card
                    key={i}
                    id={robots[i].id}
                    name={robots[2].name}
                    email={robots[2].email} />
            })}
        </div>
    );
}

export default CardList;
